column8:
ヘリカル方式コイル内蔵により、純正品同等の感度を確保したショートアンテナです。ショート化しながら、通常では問題のない受信感度を実現。ショートアンテナを純正アンテナと交換するだけの簡単取付！<br><br>●全長：102mm ●上部：8φmm ●下部：15φmm ●カラー：ブラック ●5/6φmmアダプター付属 ●スペーサーリング付属（車種によりアンテナ取付口に隙間ができる場合のみに使用します。）<br><br>※装着時に強く締めすぎると破損の恐れがありますのでご注意ください。<br>※山間部や高層ビルの下などでは受信感度が落ちる場合があります。<br><br>対応車種：03/10～09/6 BK#P アクセラスポーツ <br><br>車検対応品<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


