純正アンテナをショートタイプにすることにより、スタイリッシュになります。立体駐車場でもアンテナを気にせず車庫入れができるようになります。<br><br>取付けもネジ式ですので回して付け替えるだけ！取り付けアダプター4mm、5mm、6mmの3個付属しています。で幅広い車種に対応しています。高さ約5mmのスペーサー付属。取付け時にできる隙間が埋めれるようになりました！※アンテナと台座に隙間が空く場合にご使用ください。<br><br>※本製品にはヘリカル方式コイルを内蔵しておりません。デザインを重視して企画された製品です。通常での受信感度は問題はありませんが純正アンテナから比較しますと受信感度は低下します。山間部、高層な建物の下などでは著しく感度が低下する場合があります。特にAMラジオはノイズが出やすい状況になりますのでご了承下さい。本製品はFM/AMラジオ対応アンテナです。通信機能を備えたナビゲーションアンテナには対応できない場合があります。※本製品はメール便でのお届けの為、代引き不可となります。後了承下さい。<br><br><br>対応車種：TOYOTA　　アイシス　04．9～　ANM／ZNM1＃Ｗ　<br><br>ボディパーツ | アンテナ・チューナー<br>トヨタ | アイシス | ANM/ZNM10系<tr><td colspan="2">
